(257, 3, '_wp_suggested_privacy_policy_content', 'a:3:{s:11:\"plugin_name\";s:9:\"WordPress\";s:11:\"policy_text\";s:11804:\"<div class=\"wp-suggested-text\"><h2>Who we are</h2><p class=\"privacy-policy-tutorial\">In this section you should note your site URL, as well as the name of the company, organization, or individual behind it, and some accurate contact information.</p><p class=\"privacy-policy-tutorial\">The amount of information you may be required to show will vary depending on your local or national business regulations. You may, for example, be required to display a physical address, a registered address, or your company registration number.</p><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Our website address is: http://themeboxr.local.</p><h2>What personal data we collect and why we collect it</h2><p class=\"privacy-policy-tutorial\">In this section you should note what personal data you collect from users and site visitors. This may include personal data, such as name, email address, personal account preferences; transactional data, such as purchase information; and technical data, such as information about cookies.</p><p class=\"privacy-policy-tutorial\">You should also note any collection and retention of sensitive personal data, such as data concerning health.</p><p class=\"privacy-policy-tutorial\">In addition to listing what personal data you collect, you need to note why you collect it. These explanations must note either the legal basis for your data collection and retention or the active consent the user has given.</p><p class=\"privacy-policy-tutorial\">Personal data is not just created by a user&#8217;s interactions with your site. Personal data is also generated from technical processes such as contact forms, comments, cookies, analytics, and third party embeds.</p><p class=\"privacy-policy-tutorial\">By default WordPress does not collect any personal data about visitors, and only collects the data shown on the User Profile screen from registered users. However some of your plugins may collect personal data. You should add the relevant information below.</p><h3>Comments</h3><p class=\"privacy-policy-tutorial\">In this subsection you should note what information is captured through comments. We have noted the data which WordPress collects by default.</p><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.</p><p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p><h3>Media</h3><p class=\"privacy-policy-tutorial\">In this subsection you should note what information may be disclosed by users who can upload media files. All uploaded files are usually publicly accessible.</p><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><h3>Contact forms</h3><p class=\"privacy-policy-tutorial\">By default, WordPress does not include a contact form. If you use a contact form plugin, use this subsection to note what personal data is captured when someone submits a contact form, and how long you keep it. For example, you may note that you keep contact form submissions for a certain period for customer service purposes, but you do not use the information submitted through them for marketing purposes.</p><h3>Cookies</h3><p class=\"privacy-policy-tutorial\">In this subsection you should list the cookies your web site uses, including those set by your plugins, social media, and analytics. We have provided the cookies which WordPress installs by default.</p><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><p>If you have an account and you log in to this site, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><h3>Embedded content from other websites</h3><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><h3>Analytics</h3><p class=\"privacy-policy-tutorial\">In this subsection you should note what analytics package you use, how users can opt out of analytics tracking, and a link to your analytics provider&#8217;s privacy policy, if any.</p><p class=\"privacy-policy-tutorial\">By default WordPress does not collect any analytics data. However, many web hosting accounts collect some anonymous analytics data. You may also have installed a WordPress plugin that provides analytics services. In that case, add information from that plugin here.</p><h2>Who we share your data with</h2><p class=\"privacy-policy-tutorial\">In this section you should name and list all third party providers with whom you share site data, including partners, cloud-based services, payment processors, and third party service providers, and note what data you share with them and why. Link to their own privacy policies if possible.</p><p class=\"privacy-policy-tutorial\">By default WordPress does not share any personal data with anyone.</p><h2>How long we retain your data</h2><p class=\"privacy-policy-tutorial\">In this section you should explain how long you retain personal data collected or processed by the web site. While it is your responsibility to come up with the schedule of how long you keep each dataset for and why you keep it, that information does need to be listed here. For example, you may want to say that you keep contact form entries for six months, analytics records for a year, and customer purchase records for ten years.</p><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><h2>What rights you have over your data</h2><p class=\"privacy-policy-tutorial\">In this section you should explain what rights your users have over their data and how they can invoke those rights.</p><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><h2>Where we send your data</h2><p class=\"privacy-policy-tutorial\">In this section you should list all transfers of your site data outside the European Union and describe the means by which that data is safeguarded to European data protection standards. This could include your web hosting, cloud storage, or other third party services.</p><p class=\"privacy-policy-tutorial\">European data protection law requires data about European residents which is transferred outside the European Union to be safeguarded to the same standards as if the data was in Europe. So in addition to listing where data goes, you should describe how you ensure that these standards are met either by yourself or by your third party providers, whether that is through an agreement such as Privacy Shield, model clauses in your contracts, or binding corporate rules.</p><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Visitor comments may be checked through an automated spam detection service.</p><h2>Your contact information</h2><p class=\"privacy-policy-tutorial\">In this section you should provide a contact method for privacy-specific concerns. If you are required to have a Data Protection Officer, list their name and full contact details here as well.</p><h2>Additional information</h2><p class=\"privacy-policy-tutorial\">If you use your site for commercial purposes and you engage in more complex collection or processing of personal data, you should note the following information in your privacy policy in addition to the information we have already discussed.</p><h3>How we protect your data</h3><p class=\"privacy-policy-tutorial\">In this section you should explain what measures you have taken to protect your users&#8217; data. This could include technical measures such as encryption; security measures such as two factor authentication; and measures such as staff training in data protection. If you have carried out a Privacy Impact Assessment, you can mention it here too.</p><h3>What data breach procedures we have in place</h3><p class=\"privacy-policy-tutorial\">In this section you should explain what procedures you have in place to deal with data breaches, either potential or real, such as internal reporting systems, contact mechanisms, or bug bounties.</p><h3>What third parties we receive data from</h3><p class=\"privacy-policy-tutorial\">If your web site receives data about users from third parties, including advertisers, this information must be included within the section of your privacy policy dealing with third party data.</p><h3>What automated decision making and/or profiling we do with user data</h3><p class=\"privacy-policy-tutorial\">If your web site provides a service which includes automated decision making - for example, allowing customers to apply for credit, or aggregating their data into an advertising profile - you must note that this is taking place, and include information about how that information is used, what decisions are made with that aggregated data, and what rights users have over decisions made without human intervention.</p><h3>Industry regulatory disclosure requirements</h3><p class=\"privacy-policy-tutorial\">If you are a member of a regulated industry, or if you are subject to additional privacy laws, you may be required to disclose that information here.</p></div>\";s:5:\"added\";i:1538814151;}'),
(258, 3, '_wp_suggested_privacy_policy_content', 'a:3:{s:11:\"plugin_name\";s:11:\"WooCommerce\";s:11:\"policy_text\";s:4178:\"\n			<div contenteditable=\"false\"><p class=\"wp-policy-help\">This sample language includes the basics around what personal data your store may be collecting, storing and sharing, as well as who may have access to that data. Depending on what settings are enabled and which additional plugins are used, the specific information shared by your store will vary. We recommend consulting with a lawyer when deciding what information to disclose on your privacy policy.</p></div><p>We collect information about you during the checkout process on our store.</p><h2>What we collect and store</h2><p>While you visit our site, we’ll track:</p><ul><li>Products you’ve viewed:  we’ll use this to, for example, show you products you’ve recently viewed</li><li>Location, IP address and browser type: we’ll use this for purposes like estimating taxes and shipping</li><li>Shipping address: we’ll ask you to enter this so we can, for instance, estimate shipping before you place an order, and send you the order!</li></ul><p>We’ll also use cookies to keep track of cart contents while you’re browsing our site.</p><div contenteditable=\"false\"><p class=\"wp-policy-help\">Note: you may want to further detail your cookie policy, and link to that section from here.</p></div><p>When you purchase from us, we’ll ask you to provide information including your name, billing address, shipping address, email address, phone number, credit card/payment details and optional account information like username and password. We’ll use this information for purposes, such as, to:</p><ul><li>Send you information about your account and order</li><li>Respond to your requests, including refunds and complaints</li><li>Process payments and prevent fraud</li><li>Set up your account for our store</li><li>Comply with any legal obligations we have, such as calculating taxes</li><li>Improve our store offerings</li><li>Send you marketing messages, if you choose to receive them</li></ul><p>If you create an account, we will store your name, address, email and phone number, which will be used to populate the checkout for future orders.</p><p>We generally store information about you for as long as we need the information for the purposes for which we collect and use it, and we are not legally required to continue to keep it. For example, we will store order information for XXX years for tax and accounting purposes. This includes your name, email address and billing and shipping addresses.</p><p>We will also store comments or reviews, if you choose to leave them.</p><h2>Who on our team has access</h2><p>Members of our team have access to the information you provide us. For example, both Administrators and Shop Managers can access:</p><ul><li>Order information like what was purchased, when it was purchased and where it should be sent, and</li><li>Customer information like your name, email address, and billing and shipping information.</li></ul><p>Our team members have access to this information to help fulfill orders, process refunds and support you.</p><h2>What we share with others</h2><div contenteditable=\"false\"><p class=\"wp-policy-help\">In this section you should list who you’re sharing data with, and for what purpose. This could include, but may not be limited to, analytics, marketing, payment gateways, shipping providers, and third party embeds.</p></div><p>We share information with third parties who help us provide our orders and store services to you; for example --</p><h3>Payments</h3><div contenteditable=\"false\"><p class=\"wp-policy-help\">In this subsection you should list which third party payment processors you’re using to take payments on your store since these may handle customer data. We’ve included PayPal as an example, but you should remove this if you’re not using PayPal.</p></div><p>We accept payments through PayPal. When processing payments, some of your data will be passed to PayPal, including information required to process or support the payment, such as the purchase total and billing information.</p><p>Please see the <a href=\"https://www.paypal.com/us/webapps/mpp/ua/privacy-full\">PayPal Privacy Policy</a> for more details.</p>\";s:5:\"added\";i:1538814151;}'),
