(68, 3, '2019-07-26 23:46:53', '2019-07-26 17:46:53', 'Themeboxr is committed to protecting your privacy and developing technology that gives you the most powerful and safe online experience. This Statement of Privacy applies to the Themeboxr.com Web site and governs data collection and usage. By using the Themeboxr website or it\'s demo or family sites, you consent to the data practices described in this statement.\n<h4>Collection of your Personal Information</h4>\nThemeboxr collects personally identifiable information, such as your e-mail address, name, home or work address or telephone number only upon your submission. Themeboxr also collects anonymous demographic information, which is not unique to you, such as your ZIP code, age, gender, preferences, interests and favorites.\n\nThere is also information about your computer hardware and software that is automatically collected by Themeboxr. This information can include: your IP address, browser type, domain names, access times and referring Web site addresses. This information is used by Themeboxr for the operation of the service, to maintain quality of the service, and to provide general statistics regarding use of the Themeboxr Web site only.\n\nPlease keep in mind that if you directly disclose personally identifiable information or personally sensitive data through Themeboxr public message boards, this information may be collected and used by others. Note: Themeboxr does not read any of your private online communications.\n\nThemeboxr encourages you to review the privacy statements of Web sites you choose to link to from Themeboxr so that you can understand how those Web sites collect, use and share your information. Themeboxr is not responsible for the privacy statements or other content on Web sites outside of the Themeboxr  and Themeboxr family of Web sites.\n<h4>Use of your Personal Information</h4>\nThemeboxr  collects and uses your personal information to operate the Themeboxr Web site and deliver the services you have requested. Themeboxr  also uses your personally identifiable information to inform you of other products or services available from Themeboxr  and its affiliates. Themeboxr may also contact you via surveys to conduct research about your opinion of current services or of potential new services that may be offered.\n\nThemeboxr does not sell, rent or lease its customer lists to third parties. Themeboxr may, from time to time, contact you on behalf of external business partners about a particular offering that may be of interest to you. In those cases, your unique personally identifiable information (e-mail, name, address, telephone number) is not transferred to the third party.\n\nThemeboxr Web sites will disclose your personal information, without notice, only if required to do so by law or in the good faith belief that such action is necessary to: (a) conform to the edicts of the law or comply with legal process served on Themeboxr or the site; (b) protect and defend the rights or property of Themeboxr ; and, (c) act under exigent circumstances to protect the personal safety of users of Themeboxr , or the public.\n<h4>Changes to this Statement</h4>\nThemeboxr will occasionally update this Statement of Privacy to reflect company and customer feedback. Themeboxr encourages you to periodically review this Statement to be informed of how Themeboxr is protecting your information.\n<h4>Contact Information</h4>\nThemeboxr welcomes your comment regarding this Statement of Privacy. If you believe that Themeboxr has not adhered to this Statement, please <a href=\"http://themeboxr.com/contact-us\">contact</a> Themeboxr , info at themeboxr.com We will use commercially reasonable efforts to promptly determine and remedy the problem.\n<h4>Please also read:</h4>\n<ul>\n	<li><a href=\"https://themeboxr.com/tos\">Terms &amp; Conditions</a></li>\n	<li><a href=\"https://themeboxr.com/refund-policy\">Refund Policy</a></li>\n</ul>', 'Privacy Policy', '', 'inherit', 'closed', 'closed', '', '3-autosave-v1', '', '', '2019-07-26 23:46:53', '2019-07-26 17:46:53', '', 3, 'http://themeboxr.local/3-autosave-v1/', 0, 'revision', '', 0),
