(70, 3, '2018-10-06 14:27:42', '2018-10-06 08:27:42', 'All products (\"software\") released by Themeboxr is tested thoroughly on all the versions for the CMS they are intended for. On top of that we are also happy to provide additional technical support (\"free support\" for basic troubleshooting, and \"paid on hourly basis\" for extended support).\r\n\r\nUnlike physical goods, electronically distributed software and software licenses can be easily duplicated. Once we have distributed a release version to the customer, the sale is final, and you may not return the software for a refund or credit without any valid reason. Please be cautious and make sure you know what you are purchasing.\r\n\r\nIn special cases due to inherent problem in client\'s end such as a conflicting plugin / module, corrupted components of CMS, a Product may not work. In such cases, once after basic troubleshooting is done, we may refund 100% .\r\n\r\nFinding a bug in our products is not a reason for a refund. If you do find bugs, please report them so that we can fix them. Use our <a href=\"http://themeboxr.com/contact-us.html\">contact page</a> to any bug report, we will get back to you as soon as possible and maximum 24 hours. We consider Friday and Saturday as weekend and may respond on the next available day asap, please have patience.\r\n\r\n<strong>Themeboxr reserves the right to approve refunds in the following cases ONLY:</strong>\r\n<ul>\r\n	<li>Product doesn\'t work as it\'s described and we failed to fix <a href=\"http://en.wikipedia.org/wiki/Software_bug\">bug</a> and don\'t provide any support about your question that is relevant to our product (\"software\")</li>\r\n	<li>Product doesn\'t have the features listed in the product description page</li>\r\n	<li>100% refund but we recommend you contact with us about any problem.</li>\r\n	<li>You bought the product from Themeboxr or it\'s family web sites</li>\r\n	<li>Provide all necessary information about your purchase like the first