ransaction id (email), transaction date etc.</li>\n</ul>\nPlease also read:\n<ul>\n	<li><a href=\"https://themeboxr.com/tos\">Terms &amp; Conditions</a></li>\n	<li><a href=\"https://themeboxr.com/privacy\">Privacy Statement</a></li>\n</ul>', 'Refund Policy', '', 'inherit', 'closed', 'closed', '', '70-autosave-v1', '', '', '2019-06-20 11:09:02', '2019-06-20 05:09:02', '', 70, 'https://themeboxr.com/70-autosave-v1/', 0, 'revision', '', 0),
